class HomeFragment : Fragment(), EventsAdapter.OnEventClick {

    private lateinit var view: View

    private lateinit var viewPager: ViewPager
    private lateinit var listNews: List<NewsModel>
    private lateinit var pagerAdapter: NewsPagerAdapter

    private lateinit var recyclerEvents: RecyclerView
    private lateinit var eventsAdapter: EventsAdapter
    private lateinit var listEvents: MutableList<EventsModel>


    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?, savedInstanceState: Bundle?
    ): View {

        view = inflater.inflate(R.layout.fragment_home, container, false)

        viewPager = view.findViewById(R.id.viewPagerNews)
        recyclerEvents = view.findViewById(R.id.recyclerEvents)




        setViewPager()
        setRecyclerEvents()

        return view
    }


    private fun setViewPager() {
        listNews = ArrayList()

        listNews = listNews + NewsModel(
            "Andro development",
            ""
        )
        listNews = listNews + NewsModel(
            "Andro development",
            ""
        )
        listNews = listNews + NewsModel(
            "Andro development",
            ""
        )
        listNews = listNews + NewsModel(
            "Andro development",
            ""
        )
        listNews = listNews + NewsModel(
            "Andro development",
            ""
        )
        listNews = listNews + NewsModel(
            "Andro development",
            ""
        )
        listNews = listNews + NewsModel(
            "Image",
            ""
        )

        pagerAdapter = NewsPagerAdapter(view.context, listNews)


        viewPager.adapter = pagerAdapter

        if (listNews.isNotEmpty()) {
            viewPager.autoScroll(5000)
        }
    }

    private fun setRecyclerEvents() {
        listEvents = mutableListOf()
        eventsAdapter = EventsAdapter(listEvents, this)


        listEvents.add(EventsModel("Event","12/3" , listNews[1].encodedString))
        listEvents.add(EventsModel("Event", "7/8", listNews[1].encodedString))



        recyclerEvents.layoutManager = LinearLayoutManager(view.context)
        recyclerEvents.adapter = eventsAdapter

    }

    private fun ViewPager.autoScroll(interval: Long) {

        val handler = Handler()
        var scrollPosition = 0

        val runnable = object : Runnable {

            override fun run() {

                /**
                 * Calculate "scroll position" with
                 * adapter pages count and current
                 * value of scrollPosition.
                 */
                val count = adapter?.count ?: 0
                setCurrentItem(scrollPosition++ % count, true)

                handler.postDelayed(this, interval)
            }
        }

        addOnPageChangeListener(object : ViewPager.OnPageChangeListener {
            override fun onPageSelected(position: Int) {
                // Updating "scroll position" when user scrolls manually
                scrollPosition = position + 1
            }

            override fun onPageScrollStateChanged(state: Int) {
                // Not necessary
            }

            override fun onPageScrolled(
                position: Int, positionOffset: Float, positionOffsetPixels: Int
            ) {
                // Not necessary
            }
        })

        handler.post(runnable)
    }

    override fun onClick(position: Int, item: EventsModel) {
        TODO("Not yet implemented")
    }
}